INSERT INTO `article` VALUES ('29', '徐兴桥', '金融学是学什么的', '\r\n<div><p>主要学习政治经济学、西方经济学、财政学、国际经济学、货币银行学、国际金融管理、证券投资学、保险学、商业银行业务管理、中央银行业务、投资银行理论与实务等。</p></div><div><p>在金融理论方面主要研究课题有：货币的本质、职能及其在经济中的地位和作用；信用的形式、银行的职能以及它们在经济中的地位和作用；利息的性质和作用；在现代银行信用基础上组织起来的货币流通的特点和规律；通过货币对经济生活进行宏观控制的理论等等。<br>就业方向：基金公司、证券公司、金融机构、银行等。可从事基金绩效评估、风险控制、资产配置、理财产品设计、债券市场操作、公司债券市场产品设计、抵押支持债券产品设计等工作。<br>人类已经进入金融时代、金融社会，因此，金融无处不在并已形成一个庞大体系，金融学涉及的范畴、分支和内容非常广，如货币、证券、银行、保险、资本市场、衍生证券、投资理财、各种基金（私募、公募）、国际收支、财政管理、贸易金融、地产金融、外汇管理、风险管理等。<br>金融学领域的学科交叉与创新发展的趋势非常明显，涌现出许多引人注目的新兴边缘学科，如演化金融学（Evolutionary Finance）就是介于生物学和金融学的一门边缘科学，演化证券学则是介于生物学和证券学之间的边缘学科。</p></div>\r\n\r\n', '金融', '金融', '1', '2024-03-07 21:46:00', '2024-03-07 21:46:00', null);
